DROP TABLE IF EXISTS `creature_difficulty`;
CREATE TABLE `creature_difficulty` (
  `ID` MEDIUMINT(8) NOT NULL DEFAULT '0',
  `CreatureID` MEDIUMINT(8) NOT NULL DEFAULT '0',
  `FactionTemplateID` MEDIUMINT(8) NOT NULL DEFAULT '0',
  `Expansion` MEDIUMINT(8) NOT NULL DEFAULT '0',
  `MinLevel` MEDIUMINT(8) NOT NULL DEFAULT '0',
  `MaxLevel` MEDIUMINT(8) NOT NULL DEFAULT '0',
  `UnkMoP1` INT(10) UNSIGNED NOT NULL DEFAULT '0',
  `UnkMoP2` INT(10) NOT NULL DEFAULT '0',
  `UnkMoP3` INT(10) NOT NULL DEFAULT '0',
  `UnkMoP4` INT(10) UNSIGNED NOT NULL DEFAULT '0',
  `UnkMoP5` INT(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

